(let [result (zipmap (vals broadcasters) (map (fn [id] (remove #(> % 100) (lifetime id t0 tmax :distribution))) (keys broadcasters)))
       dat {:yvar (apply concat (vals result))
            :xvar (mapcat (fn [[k v]] (repeat (count v) (element-name k))) result)
            }]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :xvar :yvar] ]
         [:geom_boxplot]
    	 [:stat_summary {:fun.y :mean, :geom "point" :shape 1 :size 2}]
         [:guides {:fill "none"}]
         [:xlab "Broadcaster"]
         [:ylab "Average lifetime in hours"]
         [:theme_bw]
         [:ggtitle "Average lifetime distribution"])]
      {:width 12 :height 6 })) 
